// src/components/Header/Header.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import s from './Header.module.scss';

const Header = () => {
  return (
    <header className="header">
        <div className="header__container">
            <nav className="header__nav">
                <nav className="header__nav-left">
                    <Link to="/menu" className="header__nav-link">le menu</Link>
                    <Link to="#" className="header__nav-link">contact</Link>
                </nav>
                <Link to="/home">
                    <div className="header__logo"></div>
                </Link>
                <nav className="header__nav-right">
                    <Link to="#" className="header__nav-link">mon panier</Link>
                    <Link to="#" className="header__nav-link">lang</Link>
                </nav>
            </nav>
        </div>
    </header>
  );
};

export default Header;
